import React, { Component } from "react";

class Header extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col">
            <button className="btn">
              <i className="far fa-bars" />
            </button>
          </div>
          <div className="col"></div>
        </div>
      </div>
    );
  }
}

export default Header;
